import { Component } from '@angular/core';

@Component({
  selector: 'app-user-album-photos',
  templateUrl: './user-album-photos.component.html',
  styles: [
  ]
})
export class UserAlbumPhotosComponent {
  constructor( public UService:UsersService){}
  users:any;

ngOnInit(): void {
      this.UService.GetAllUsers().subscribe({
    next:(data)=>{
      // console.log(data)
      this.users = data;
    },
    error:(err)=>{console.log(err)}
  })
}
}
